/// <summary>
/// Count the days in the <c>WorkTimeCopyDay</c>, if equal or less than 8 refresh the database search and update the form.
/// </summary>
/// <param name = "_classObject">The class object.</param>
void doResearch(Object _classObject = null)
{
    int                 dayCounter = 1;
    WorkTimeCopyDay     workTimeCopyDay;

    if (classnum(WorkTimeCopyDay) == classidget(_classObject))
    {
        workTimeCopyDay = _classObject;
        dayCounter      = workTimeCopyDay.parmToWeekDay() - 1 + firstDayDS;
    }

    if (dayCounter <= 8)
    {
        this.dataSource(dayCounter).research();
    }

    workTimeTable_ds.reread();
    workTimeTable_ds.refresh();
}

/// <summary>
/// Init the form.
/// </summary>
void init()
{
    mapHours = new Map(Types::String, Types::Real);

    super();
}

/// <summary>
/// Remove the display cache if <c>WorkTimeLine</c> record exist in the map hours.
/// </summary>
/// <param name = "_workTimeLine">The work time line record.</param>
protected void removeDisplayCache(WorkTimeLine _workTimeLine)
{
    if (mapHours.exists(_workTimeLine.cacheKey()))
    {
        mapHours.remove(_workTimeLine.cacheKey());
    }
}

/// <summary>
/// Calculate hours and add it to the map hours.
/// </summary>
/// <param name = "_workTimeLine">The work time line record.</param>
/// <returns>THe calculated hours.</returns>
private HoursPerDay calculateHours(WorkTimeLine _workTimeLine)
{
    if (!mapHours.exists(_workTimeLine.cacheKey()))
    {
        mapHours.insert(
                _workTimeLine.cacheKey(),
                WorkTimeLine::calcDefinedSeconds(_workTimeLine.WorkTimeId, _workTimeLine.WeekDay) / 3600);
    }

    return mapHours.lookup(_workTimeLine.cacheKey());
}

/// <summary>
/// Call the work time copy day menu function.
/// </summary>
/// <param name = "_weekday">The weekday to copy from.</param>
private void workTimeCopyDayMenuFunction(WeekDay _weekday)
{
    MenuFunction    menuFunction;
    args            args = new Args();

    args.caller(element);
    args.record(WorkTimeTable);
    args.parmEnum(_weekday);

    menuFunction = new menufunction(identifierstr(WorkTimeCopyDay), MenuItemType::Action);
    menuFunction.run(args);
}

